import React from 'react';
import {StyleSheet, Text, View, ScrollView, Image, TouchableWithoutFeedback} from 'react-native';



export default function RestauranteMenu({navigation, route}){
    //<Image source={restaurante.image} style={styles.image}/> 
    const restaurante = route.params.restaurante;
    return(
        <View>
            <Text>FODASSE</Text>
            <ScrollView>{
                Object.keys(restaurante.Pratos).map(prato => {
                    <View style={styles.container}>
                        <Image style={styles.image} source={restaurante.Pratos[prato].image}/>
                        <Text style={styles.foodText}>{prato}</Text>
                    </View>
                })   
            }</ScrollView>
        </View>

    );
}



const styles = StyleSheet.create({
    container: {
      backgroundColor: 'white',
      paddingBottom: 10,
      flexDirection: 'column'
    },
    foodText: {
        fontSize:  15,
        fontWeight: 'bold',
        textAlign: 'center',
      },
    image: {
        width: 150,
        height: 100,
    }
});
